  JWILLIAMS, Philip Nicholas and TIMMS, Heather Jean
  03> WILLIAMS, Philip Nicholas m on 16.02.1991 to TIMMS, Heather Jean
  b 31.01.1963.
  b 01.12.1963
  Philip b. at Hastings and m. at Christchurch. Address: 68 Homewood Avenue, Wellington.
  Philip was educated at Wanganui Collegiate School and Lincoln College. He is Head of Wholesale
  Services for ANZ Fund Management. Heather is Head of Marketing Services (NZ) for the ANZ Bank in
  Wellington.
  01> WILLIAMS, Scott Douglas
  b 08.08.1996
  02> WILLIAMS, Nicholas Duncan m on 12.11.1994 to (2) TAYLOR, Jennifer
  b 14.06.1932
  b ** ** ****
  Nicholas m. at Southampton, England. Jennifer, dlo Hermon Taylor (Harley Street surgeon) and Mairie
  Taylor, of London, England. Address: Bonnett Farm, Marsden, Cirencester, Gloucestershire GLT 7ET,
  England.
  When farming in New Zealand, Nicholas was a member of the executive committee of the Hawkes Bay A&P
  Society and for a time was chairman of the Horses Committee. He was actively engaged in the affairs of
  the New Zealand Horse Society, and was chairman of the Dressage Committee (1970-78) and Director of the
  Society (1977-84).
  Nicholas was elected to the Bureau of the International Equestrian Federation (FEI) in 1983-92, and was
  then elected an Honorary Member. He served on the FEI Dressage Committee in 1981-83, and again in
  1993-96 as deputy chairman. He has judged in some 25 countries around the world, including several
  time the World Cup Final, the European Championships, the Asian Games (1986), the Olympic Games (1988
  and 1992), and the World Championships (1994). He was a member of the Appeal Committee at the World
  Championships in 1990 and the Olympic Games in 1996.
  03> WILLIAMS, Ellen Mary (Molly)
  b 05.05.1903
  Ellen b. at St Lawrence. She was a missionary in Melanesia and England.
  04> WILLIAMS, Sarah Cooper (Sally) m on 15.04.1936 to WIGLEY, Edward Thomas
  Cranstoun
  b 05.03.1907 d 07.05.1987
  b 08.03.1910 d ** **.1967
  Sally b, at "St Lawrence" station and educated at Chilton St James and Woodford House in Havelock North.
  Her interests included music, needlework and gardening.
  Tom was educated at Christ's College, Christchurch, and King's College, Auckland. He had numerous
  community interests and enjoyed boxing, hunting and fishing. He and Sally owned a beach resort at Waipu
  Cove, Northland, and then bought a sheep and beef farm at Maungaturoto. When Tom died, Sally retired to
  Paihia.
  01> WIGLEY, Marjorie Julia Cranstoun m on 24.05.1958 to MANNION, Neil de Vere
  b 18.05.1937
  b 03.06.1934
  Neil, s/o Gerald Mannion and Edna Purser. Address: PO Box 93, Maungatapere,
  Northland.
  Julia was educated at Waipu Primary School and Nga Tawa School, Marton. Her
  interests include Family Court mediation and counselling and playing golf.
  Neil was educated at Coromandel Primary School and Wesley College, Auckland.
  He and Julia are now farmers and avocado orchardists. Neil is president of
  the Whangarei Golf Club and president of the Whangarei Avocado Growers' Association. He is a keen game
  fisherman and was New Zealand champion angler in 1997.
